  async filterWithDates(start?, end?, pageNo?) {
    this.filterPageCount = pageNo;
    this.spinner.show();
    this.common.loaderText= 'Fetching payments & transactions...';
    const response: any = await this.api.apiProcess({
      type: 'filterPaymentsWithDates',
      from: start,
      to: end,
      page: this.filterPageCount
    })
      .toPromise();

    if (response.result.status.res.length === 0) {
      this.noPayments = true;
      this.spinner.hide();
      this.common.loaderText = 'Loading...';
    }
    if(response.result.status.res.length > 0) {
      this.showPaymentData = false;
      this.showFilterdData = true;
      this.noPayments = false;
      this.filteredData = response.result.status.res ?? [];
      this.filterButtonDisabled = false;

      this.filterLastPage = Math.ceil(response.result.status.count / 10);
      this.filterNextPage = this.filterPageCount + 1;

      if(this.filterLastPage + 1 === this.filterNextPage) {
        this.filterButtonDisabled = true;
      }
      this.spinner.hide();
      this.common.loaderText = 'Loading...';
    }
  }

  async getPaymentHistory(pageNo?) {
    this.pageCount = pageNo;
    this.showFilterdData = false;
    this.showPaymentData = true;
    this.spinner.show();
    this.common.loaderText= 'Fetching payments & transactions...';

    const res: any = await this.api
      .apiProcess({
        type: 'getPaymentTransactions',
        page: this.pageCount,
      })
      .toPromise();
    if(res.result.status.res.length === 0) {
      this.spinner.hide();
      this.common.loaderText = 'Loading...';
      this.noPaymentData = true;
    }
    this.paymentHistory = [...this.paymentHistory, ...res.result.status.res];
    this.lastPage = Math.ceil(res.result.status.count / 10);
    this.nextPage = this.pageCount + 1;

    if (this.lastPage + 1 === this.nextPage) {
      this.buttonDisabled = true;

    }
    this.spinner.hide();
    this.common.loaderText = 'Loading...';
  }

